import React, { useState } from 'react';

function Mypage() {
  const [currentPage, setCurrentPage] = useState(1);

  return (
    <div className="max-w-[480px] mx-auto min-h-screen bg-white px-5 py-6">
      {/* 헤더 */}
      <h1 className="mb-6 text-2xl font-bold">마이페이지</h1>

      {/* 사용자 정보 */}
      <div className="bg-[#ECFFF8] rounded-lg p-5 mb-8 relative">
        <h2 className="mb-2 text-xl">&&*(투엠퍼센트) 님</h2>
        <p className="text-sm text-black">likelion@naver.com</p>
        <button className="absolute text-xl -translate-y-1/2 right-5 top-1/2">메모장이미지</button>
      </div>

      {/* 참여 코스 섹션 */}
      <section className="mb-8">
        <h3 className="mb-4 text-lg font-semibold">내가 참여한 코스</h3>
        <div className="grid grid-cols-2 gap-4 mb-6">
          {/* 코스 아이템 */}
          {[1, 2, 3, 4].map((item) => (
            <div key={item} className="p-3 bg-gray-100 rounded-lg">
              <div className="bg-gray-300 w-full h-[120px] rounded-md mb-2"></div>
              <p className="text-sm text-center">캠퍼스 러닝 코스</p>
            </div>
          ))}
        </div>

        {/* 페이지네이션 */}
        <div className="flex items-center justify-center gap-2">
          <button className="text-gray-400">
            <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M15 18L9 12L15 6" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
          </button>
          {[1, 2, 3].map((page) => (
            <button
              key={page}
              onClick={() => setCurrentPage(page)}
              className={`w-8 h-8 rounded ${
                page === currentPage ? 'bg-[#B4FFE3] text-[#48CBC8]' : 'text-[#D1D5D7]'
              }`}
            >
              {page}
            </button>
          ))}
          <button className="text-gray-400">
            <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M9 18L15 12L9 6" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
          </button>
        </div>
      </section>

      {/* 메뉴 섹션 */}
      <div className="mt-10">
        <div className="py-4 font-semibold ">문의</div>
        <div className="py-4 font-semibold font-family: Pretendard">로그아웃</div>
      </div>
    </div>
  );
}

export default Mypage;
